import React from 'react'
import Navbar from '../../components/navbar/Navbar'
export default function NotFound() {
	return (
		<>
			<Navbar />
			<div className="not-found-wrapper">
				<h1> 404 NOT FOUND </h1>
			</div>
		</>
	)
}
